import { createStore } from 'redux';

function reducer() {
    return {
        processListingData: [],
        processRegisteringData: {
            processName: '',
            processSubject: '',
            processDescription: '',
            processConcernment: [],
        }
    };
}

const store = createStore(reducer);

export default store;
